<script>
    //const mqtt = require('mqtt')
    //import mqtt from 'mqtt'

    // connection option
    const options = {
        clean: true, // retain session
        connectTimeout: 4000, // Timeout period
        // Authentication information
        clientId: _uuid(),
        username: 'web',
        password: 'web',
    }

    // Connect string, and specify the connection method by the protocol
    // ws Unencrypted WebSocket connection
    // wss Encrypted WebSocket connection
    // mqtt Unencrypted TCP connection
    // mqtts Encrypted TCP connection
    // wxs WeChat applet connection
    // alis Alipay applet connection
    // const connectUrl = 'ws://192.168.7.122:8083/mqtt'
    const connectUrl = 'ws://192.168.10.150:58083/mqtt'
    let nodeTopic = 'JQMS/MapInfo/node';
    let edgeTopic = 'JQMS/MapInfo/edge';
    let statusTopic = 'JQMS/AGVStatus';
    let subTopic = 'MapInfo';
    let mapid = 'DD';
    let graphid = 'DD';

    const client = mqtt.connect(connectUrl, options)
    client.on('connect', function () {
        client.subscribe([nodeTopic, edgeTopic], function (error) {
            if (!error) {
                console.log('connect:', error)
            }
        })
    })

    client.on('reconnect', (error) => {
        console.log('reconnecting:', error)
    })

    client.on('error', (error) => {
        console.log('Connection failed:', error)
    })



    function getGraphInfo() {
        //test: 7 customtest:6
        client.publish(subTopic, mapid), function (error) {
            if (!error) {
                console.log('connect:', error)
            }
        }
    }

    client.on('message', (topic, message) => {
        console.log('receive message：', topic, message.toString())
        let MRjsontext = message.toString();
        let MRData = JSON.parse(MRjsontext);
        let greenStstus = ["1","2","6","8" ];
        let yellowStstus = [ "4","7","9","246" ];
        let redStstus = [
             "3","5","11","12","13","14","15","16","17","18","20",
             "21","23","24","25","26","27","28","29","31","33","34","81"
            ];

        if (topic == statusTopic) {
            if (car.length == 0) {
                //顯示車輛圖示(比對地圖)
                for (let i = 1; i < MRData.length; i++) {
                    if (MRData[i].MapId == mapid) {
                        let id = parseInt(MRData[i].MRID);
                        car[id] = new agvcar(id, MRData[i].X, MRData[i].Y, MRData[i].Theta, 100, template,MRData[i].target_x, MRData[i].target_y,MRData[i].target_theta);
                        car[id].mrid.text(MRData[i].MRID);

                        if (MRData[i].MRID.length == 3) {
                            car[id].mrid.move(-90, -110).font('family', 'Trebuchet MS');
                        } else {
                            car[id].mrid.move(-60, -110).font('family', 'Trebuchet MS');
                        }

                        let MRdiv = document.createElement('div');
                        MRdiv = document.getElementById('DashBoard').appendChild(MRdiv);
                        MRdiv.classList.add('MR-DashBoard');
                        mrDashboards[id] = new CreateMRDashBoard(MRdiv, id);

                        let misdiv = document.createElement('div');
                        misdiv = document.getElementById('mission-time').appendChild(misdiv);
                        let misMR = document.createElement('h4');
                        let misTime = document.createElement('p');
                        misMR.innerHTML = 'MR' + MRData[i].MRID;
                        misTime.innerText = '00:00:00';
                        misdiv.appendChild(misMR);
                        misdiv.appendChild(misTime);
                        misdiv.classList.add('mis-DashBoard');
                        misDashboards[id] = misdiv;
                    }
                }
            }
            if (MRData.length > 0) {
                //顯示車圖示
                for (let i = 1; i < MRData.length; i++) {
                    if (MRData[i].GraphId == graphid) {
                        let id = parseInt(MRData[i].MRID);
                        car[id].x = MRData[i].X;
                        car[id].y = MRData[i].Y;
						car[id].theta = MRData[i].Theta;
						car[id].targetx = MRData[i].target_x;
						car[id].targety = MRData[i].target_y;
						car[id].targety = MRData[i].target_y;
                        car[id].targettheta = MRData[i].target_Theta;
                        //update MR position
                        mrmove(car[id]);

                        SetCircledashBoard(mrDashboards[id].mrspeed, 1, parseFloat(MRData[i].Velocity).toFixed(1));
                        if (MRData[i].Progress == null) {
                            SetCircledashBoard(mrDashboards[id].mrmissionrate, 100, 0);
                        }
                        else {
                            SetCircledashBoard(mrDashboards[id].mrmissionrate, 100, MRData[i].Progress * 100);
                        }

                        if (MRData[i].LBRRuntime == null) {
                            SetCircledashBoard(mrDashboards[id].mrmissionrate, 100, 0);
                        }
                        else {
                            SetCircledashBoard(mrDashboards[id].lbrtime, 40, parseFloat(MRData[i].LBRRuntime).toFixed(1));
                        }


                        //MR Soc
                        if (MRData[i].IsCharge == "true") {
                            BatteryCharge(mrDashboards[id].mrbat, parseFloat(MRData[i].SOC).toFixed(2));
                        }
                        else {
                            SetBatSOC(mrDashboards[id].mrbat, parseFloat(MRData[i].SOC).toFixed(2));
                        }

                        //MR missiontime
                        if (MRData[i].MRRuntime != null) {
                            misDashboards[id].children[1].innerText = MRData[i].MRRuntime;
                        }

                        //MR status
                        if(greenStstus.includes(MRData[i].State)){
                            // console.log(car[id].carstatus);
                            car[id].carstatus.fill('#90ee90');
                        }

                        if(yellowStstus.includes(MRData[i].State)){
                            // console.log(car[id].carstatus);
                            car[id].carstatus.fill('#ffff00');
                        }

                        if(redStstus.includes(MRData[i].State)){
                            // console.log(car[id].carstatus);
                            car[id].carstatus.fill('#ff0000');
                        }
                        
                        // if(
                        //     !greenStstus.includes(MRData[i].State) && 
                        //     !yellowStstus.includes(MRData[i].State) &&
                        //     !redStstus.includes(MRData[i].State))
                        // {
                        //     car[id].carstatus.fill('#ff0000');
                        // }

                        if (MRData[i].ConnectionState != 'CONNECTED') {
                            // car[id].carstatus.fill('#999999');
                            mrDashboards[id].status.last().remove();
                            mrDashboards[id].status = mrDashboards[id].draw
                                .add(
                                    SVG('#offline').clone().move(0, 0)
                                        .transform({
                                            //車子尺寸設定
                                            scale: 1.5,
                                            origin: [0, 0],
                                            translate: [45, 0],
                                        }).id(id + 'status')
                                )
                        }
                        else if (MRData[i].IsCharge == "true") {
                            // car[id].carstatus.fill('#9bd4c1');
                            mrDashboards[id].status.last().remove();
                            mrDashboards[id].status = mrDashboards[id].draw
                                .add(
                                    SVG('#charge').clone().move(0, 0)
                                        .transform({
                                            //車子尺寸設定
                                            scale: 1.5,
                                            origin: [0, 0],
                                            translate: [45, 0],
                                        }).id(id + 'status')
                                )
                        }
                        else if (MRData[i].IsLocked == "true") {
                            // car[id].carstatus.fill('b2ffff');
                            mrDashboards[id].status.last().remove();
                            mrDashboards[id].status = mrDashboards[id].draw
                                .add(
                                    SVG('#work').clone().move(0, 0)
                                        .transform({
                                            //車子尺寸設定
                                            scale: 1.5,
                                            origin: [0, 0],
                                            translate: [45, 0],
                                        }).id(id + 'status')
                                )
                        }
                        else {
                            // car[id].carstatus.fill('#fcee7d');
                            mrDashboards[id].status.last().remove();
                            mrDashboards[id].status = mrDashboards[id].draw
                                .add(
                                    SVG('#wait').clone().move(0, 0)
                                        .transform({
                                            //車子尺寸設定
                                            scale: 1.5,
                                            origin: [0, 0],
                                            translate: [45, 0],
                                        }).id(id + 'status')
                                )
                        }
                    }
                }
            }
            missionupdate(MRData[0]);
        }
        //Create edge
        else if (topic == edgeTopic) {
            //to Json Object
            edgeData = JSON.parse(message.toString());
            if (edgeData.length > 0) {
                for (var i = 0; i < edgeData.length; i++) {
                    if (edgeData[i].source_id > edgeData[i].target_id) {
                        let sourcex = edgeData[i].source_x;
                        let sourcey = edgeData[i].source_y;
                        edgeData[i].source_x = edgeData[i].target_x;
                        edgeData[i].source_y = edgeData[i].target_y;
                        edgeData[i].target_x = sourcex;
                        edgeData[i].target_y = sourcey;
                    }
                }
                CreateEdge(edgeData);
                client.unsubscribe(edgeTopic);
            }
            else {
                getGraphInfo();
            }
        }
        //Create Node
        else if (topic == nodeTopic) {
            //to Json Object
            nodeData = JSON.parse(message.toString());
            //排序
            nodeData.sort(function (a, b) {
                return a.target_id - b.target_id;
            });
            if (nodeData.length > 0) {
                CreateNode(nodeData);
                client.unsubscribe(nodeTopic);
                client.subscribe(statusTopic, function (error) {
                    if (!error) {
                        console.log('connect:', error)
                    }
                })
            }
            else {
                getGraphInfo();
            }
        }
    })
    getGraphInfo();

    //initialize map

    //Create Battery
    function CreateBattery(x, y, ratio, draw) {

        let gradient = draw.gradient('linear', function (add) {
            add.stop(0, '#00f7eb')
            add.stop(1, '#00a9fe')
        });

        //battery Body
        var group = draw.group();
        var rect = group.rect(80 * ratio, 40 * ratio);
        rect.fill('none').move(x, y).radius(5 * ratio);
        rect.stroke({ color: '#00ffff', width: 3 * ratio });

        //battery head
        var rect2 = group.rect(10 * ratio, 20 * ratio);
        rect2.fill('none').move(x + 80 * ratio, y + 10 * ratio).radius(2 * ratio);
        rect2.stroke({ color: '#00ffff', width: 3 * ratio });

        //Battery %
        var rect3 = group.rect(74 * ratio, 33 * ratio);
        rect3.move(x + 3 * ratio, y + 3.5 * ratio).radius(4 * ratio).fill(gradient);
        var text1 = group.text('100').move(x + 15 * ratio, y + 7 * ratio).font({ fill: '#fff', family: 'Inconsolata', size: 20 }).attr('class', 'svg-text');

        this.width = rect3.width();
        this.soc = rect3;
        this.socvalue = text1;
        this.draw = draw;
    }

    //ChargeFunction
    function BatteryCharge(bat, soc) {

        let gradient = bat.draw.gradient('linear', function (add) {
            add.stop(0, '#00f7eb')
            add.stop(1, '#00a9fe')
        });

        bat.soc.width(bat.width * soc);
        bat.soc.animate(1000).width(bat.width).loop(true, false).ease('<>');
        if (soc < 0.4 && soc >= 0.2) {
            bat.soc.fill('#f7ff00');
        }
        else if (soc < 0.2) {
            bat.soc.fill('#ff0000');
        }
        else {
            bat.soc.fill(gradient);
        }

        bat.socvalue.text((soc * 100).toString() + '%').move(bat.socvalue.x(), bat.socvalue.y()).font({ size: 15 }).attr('class', 'svg-text');
    }

    //Change Battery SOC
    function SetBatSOC(bat, soc) {

        let gradient = bat.draw.gradient('linear', function (add) {
            add.stop(0, '#00f7eb')
            add.stop(1, '#00a9fe')
        });

        bat.soc.timeline().finish();
        bat.soc.width(bat.width * soc);
        if (soc < 0.4 && soc >= 0.2) {
            bat.soc.fill('#f7ff00');
        }
        else if (soc < 0.2) {
            bat.soc.fill('#ff0000');
        }
        else {
            bat.soc.fill(gradient);
        }
        if (soc < 1) {
            bat.socvalue.text((soc * 100).toString() + '%').move(bat.socvalue.x(), bat.socvalue.y()).font({ fill: '#fff', family: 'Inconsolata', size: 20 }).attr('class', 'svg-text');
        }
        else {
            bat.socvalue.text((soc * 100).toString() + '%').move(bat.socvalue.x(), bat.socvalue.y()).font({ fill: '#fff', family: 'Inconsolata', size: 20 }).attr('class', 'svg-text');
        }
    }

    //Create Dashboard
    function CreateCircledashBoard(rx, ry, r, draw, unit) {
        let circlex = Math.sin(Math.PI / 180 * 5) * r + rx;
        let circley = r - Math.cos(Math.PI / 180 * 5) * r + ry;
        let circledata = 'M' + (rx).toString() + ' ' + ry + ' A' + r + ' ' + r + ' 0' + ' 0 1' + ' ' + circlex + ' ' + circley;
        draw.circle(2 * r).fill('none').stroke({ color: '#142636', width: 0.2 * r, }).move(rx, ry);
        let gradient = draw.gradient('linear', function (add) {
            add.stop(0, '#00f7eb')
            add.stop(1, '#00a9fe')
        })

        var dashboard = draw.path(circledata)
        dashboard.fill('none').move(rx + r, ry);
        dashboard.stroke({
            color: gradient,
            width: 0.2 * r,
            opacity: 0.8,
            linecap: 'round',
            linejoin: 'round'
        })


        var text = draw.text(unit).move(rx + r, ry + r + 0.2 * r).font({ fill: '#b2ffff', family: 'Inconsolata', size: 0.3 * r }).attr('class', 'svg-text');
        var text1 = draw.text('').move(rx + 0.6 * r, ry + 0.1 * r).font({ fill: '#b2ffff', family: 'Inconsolata', size: 0.8 * r }).attr('class', 'svg-text');

        this.rx = rx;
        this.ry = ry;
        this.r = r;
        this.dashboard = dashboard;
        this.txtvalue = text1;
    }

    //Dashboard Animation
    function SetCircledashBoard(dashboard, limit, value) {
        let degree = 3.6 * (value / limit) * 100;
        if (degree < 5) {
            degree = 5;
        }
        if (degree == 360) {
            degree = 359.9;
        }
        let circlex = Math.sin((Math.PI / 180) * degree) * dashboard.r + dashboard.rx;
        let circley = dashboard.r - Math.cos((Math.PI / 180) * degree) * dashboard.r + dashboard.ry;
        let circleinitial;
        if (degree > 180) {
            circleinitial = 'M' + (dashboard.rx + dashboard.r).toString() + ' ' + dashboard.ry + ' A' + dashboard.r + ' ' + dashboard.r + ' 0' + ' 1 1';
            let circledata = circleinitial + ' ' + (circlex + dashboard.r) + ' ' + circley;

            dashboard.dashboard.plot(circledata)
        }
        else {
            circleinitial = 'M' + (dashboard.rx + dashboard.r).toString() + ' ' + dashboard.ry + ' A' + dashboard.r + ' ' + dashboard.r + ' 0' + ' 0 1';
            let circledata = circleinitial + ' ' + (circlex + dashboard.r).toString() + ' ' + circley;

            dashboard.dashboard.plot(circledata);
        }
        if (value >= 100) {
            dashboard.txtvalue.text(value.toString()).move(dashboard.rx + 0.4 * dashboard.r, dashboard.ry + 0.4 * dashboard.r);
        }
        else if (value < 1 && value > 0 || value > 10) {
            dashboard.txtvalue.text(value.toString()).attr('class', 'svg-text').move(dashboard.rx + 0.55 * dashboard.r, dashboard.ry + 0.4 * dashboard.r);
        }
        else if (value < 10 || value == 0) {
            dashboard.txtvalue.text(parseFloat(value).toFixed(1).toString()).move(dashboard.rx + 0.55 * dashboard.r, dashboard.ry + 0.4 * dashboard.r);
        }

    }

    function _uuid() {
        var d = Date.now();
        if (typeof performance !== 'undefined' && typeof performance.now === 'function') {
            d += performance.now(); //use high-precision timer if available
        }
        return 'xxxxxxxx-xxxx-4xxx-yxxx-xxxxxxxxxxxx'.replace(/[xy]/g, function (c) {
            var r = (d + Math.random() * 16) % 16 | 0;
            d = Math.floor(d / 16);
            return (c === 'x' ? r : (r & 0x3 | 0x8)).toString(16);
        });
    }

    function missionupdate(missiondata) {
        let mission_complete = document.getElementById("mission-complete").children[0];
        let mission_wait = document.getElementById("mission-wait").children[0];
        let mission_warn = document.getElementById("mission-warn").children[0];

        mission_complete.innerHTML = "今日完成任務數:" + missiondata.Success;
        mission_wait.innerHTML = "待完成任務數:" + missiondata.Queue;
        mission_warn.innerHTML = "異常任務數:" + missiondata.Fail;
        let mission_Quantity = (parseFloat(missiondata.Success) + parseFloat(missiondata.Fail)).toFixed(2);
        let missionrate = 0;
        if (mission_Quantity != 0) {
            missionrate = (parseFloat(missiondata.Success) / (parseFloat(missiondata.Success) + parseFloat(missiondata.Fail))).toFixed(2) * 100;
        }
        SetCircledashBoard(missiondashboard, 100, missionrate);

    }
